import React from 'react'
import image from '../../images/office-1.jpeg'

function SignUp() {
  return (
    <div className="container">
      <div className="img-side">
        <img src="" />
        <img src={image} alt="background" />
      </div>
    </div>
  )
}

export default SignUp
